import React from 'react';
import { search } from '../../../keep-it-safe-rest/LoginRouter';

function Navigation() {

  const SearchLogins = () => {
    Axios.post("http://localhost:4500/search-result", {
      search: search
    })
  };

  return (
    <nav class="navbar navbar-expand-lg bg-dark navbar-dark">
      <div class="container-fluid">
        <a class="navbar-brand" href="/">KeepItSafe</a>
        <button class="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
          <span class="navbar-toggler-icon"></span>
        </button>
        <div class="collapse navbar-collapse" id="navbarSupportedContent">
          <ul class="navbar-nav me-auto mb-2 mb-lg-0">
            <li class="nav-item">
              <a class="nav-link" href="/add-new">Add New</a>
            </li>
            <li class="nav-item">
              <a class="nav-link" href="/view-all">View All</a>
            </li>
          </ul>
          <form class="d-flex" role="search" novalidate>
            <input class="form-control me-2" type="search" placeholder="Search" aria-label="Search" name="search"/>
            <button onClick={SearchLogins} class="btn btn-outline-light" type="submit">Search</button>
          </form>
        </div>
      </div>
    </nav>
  )
}

export default Navigation;
